// This file is automatically compiled by Webpack, along with any other files
// present in this directory. You're encouraged to place your actual application logic in
// a relevant structure within app/javascript and only use these pack files to reference
// that code so it'll be compiled.

import Rails from "@rails/ujs"
import Turbolinks from "turbolinks"
import * as ActiveStorage from "@rails/activestorage"
import "channels"
import '@fortawesome/fontawesome-free/js/all';
import "bootstrap";
import "../stylesheets/application.scss";
import "./preview.js";
import "./scroll.js";
import "jquery";
import "jquery-ui";


Rails.start()
Turbolinks.start()
ActiveStorage.start()


var jQueryUI = require('jquery-ui')
global.$.ui = global.jQuery.ui = jQueryUI;
window.$.ui = window.jQuery.ui = jQueryUI;
alert($.fn.jquery);


$(function() {
  $('#test-form').autocomplete({
    source: ["たる","かなえ","変わるよね"],
    delay: 500,
    minLength: 2,
    focus: function(event, ui) {
      $("#test-form").val(ui.item.title);
      return false;
    },
    select: function(event, ui) {
      $('#test-form').val(ui.item.title);
      return false;
    }
  }).data("ui-autocomplete")._renderItem = function(ul, item) {
    return $("<li>").attr("data-value", item.title).data("ui-autocomplete-item", item).append("<a>" + item.title + "</a>").appendTo(ul);
  };
});
